import React from 'react';
import Gallery from '../Content/Gallery';
import Footer from '../Footer/Footer';
import TopNavbar from '../Header/TopNavbar';

const Index = () => {
  return (
    <>
    <div className='page'>
        <TopNavbar/>
        <Gallery/>
        <Footer/>
    </div>
    </>
  )
}

export default Index
